import React from 'react';
import { Box, Typography } from '@mui/material';

function Help() {
  return (
    <Box>
      {/* Header Section */}
      <Box sx={{ p: 4, borderBottom: '1px solid #e0e0e0', mb: 2 }}>
        <Typography variant="h4" component="h1" sx={{ fontWeight: 'bold' }}>
          Help & Support
        </Typography>
        <Typography variant="subtitle1" sx={{ color: 'text.secondary', mt: 1 }}>
          This is the page for help and support. Content will be added here.
        </Typography>
      </Box>

      {/* Other content for the Help page can be added below */}
    </Box>
  );
}

export default Help;
